        <div id='app'>
            <h1>Fundamentos react</h1>
            <Fragmento />
            <ComParametro
                titulo="Situacao do aluno: "
                aluno="Lucas"
                nota={9.9} />
            <Primeiro></Primeiro>
        </div >
    );
}
